  return (
    <nav class="bg-blue-400 bg-opacity-50">
      <Link to={"/"}>
        <h1 class="text-4xl p-6 ">
          Sandaruwan_
          <span>
            <i class="fa-solid fa-code"></i>
          </span>
        </h1>
      </Link>
    </nav>
  );
};

export default NavBar;
